import {createAppContainer, createSwitchNavigator } from 'react-navigation';
import ListaPessoas from './telas/pessoa/index';


const  Rotas = createAppContainer(
  createSwitchNavigator(
    {
      ListaPessoas
    }
  )
)

export default function App() {
  return (    
    <Rotas/>    
  );
}
